Prisiminkite vietas, kuriose lankėtės, tyrinėdami nuotraukas, kuriose yra vietovės informacija, įskaitant bendrintas nuotraukas, kurias išsaugojote. Žemėlapis naudoja vietovės informaciją, pvz.:

 • fotoaparato GPS;
 • aptiktus orientyrus.

Nuotraukos ir vaizdo įrašai užrakintame aplanke, kurių atsarginės kopijos nebus sukurtos, nebus saugomi, jei:

 • perjungsite įrenginius;
 • atkursite gamyklinius šio įrenginio nustatymus;
 • ištrinsite „Google“ nuotraukų programą.

„Google“ nuotraukos įrenginyje visam laikui ištrins šiuos programos duomenis: 

• prijungtos paskyros; 
• nustatymai; 
• nuotraukos ir vaizdo įrašai užrakintame aplanke, kurių atsarginės kopijos nesukurtos. 

Nuotraukos ir vaizdo įrašai ne užrakintame aplanke bei kiti programų duomenys nebus ištrinti.
